import React from 'react';
import GiftList from '../../GiftList';
import API from '../../../utils/API';

class WishList extends React.Component {
    state = {
        gifts: []
    }

    componentDidMount() {
        this.getGifts()
    }

    getGifts = () => {
        API.getLists()
            .then(res => {
                this.setState({ gifts: res.data })
            })
            .catch(err => {
                console.log(err)
            })
    }

    render() {
        return (
            <div>
                <GiftList 
                    gifts={this.state.gifts}
                />
            </div>
        )
    }
}

export default WishList;
